  input: 'TEXT,F3A,,"Amendment #1: adjust interest rate on loans in section C (FECfile
    program misreported correct rate of 8.375 as 0.8375).  Also properly notates receipts
    from from J. Robert Pesce for primary and general 2002 elections, both of which
    were previously notated for the primary 2002 election.  These are clerical adjustments
    and have no effect on reported totals.   Amendment #2: clarifies adjustment for
    transaction SD10.2946 between YE-2000 and MY-2001.  Also includes FEC IDs and
    extensive names for all PACs to correct ambiguous names.  Amendment #4 (7/30/02):
    there are no clerical changes here, but changes to a previous report (Year End
    2000) required the filing of cascading amendments for all subsequent reports."'
